import productImg from "../images/illustration-stay-productive.png";

export default function Productivity() {
    return (
        <section>
            <div className="container w-[100%] flex flex-col space-x-1 items-center mx-auto justify-between md:flex-row">
                <img className="w-1/2" src={productImg} alt="" />
                <div>
                    <h2>Stay productive, wherever you are</h2>
                    <p> Never let location be an issue when accessing your files. Fylo has you covered for all of your file storage needs.</p>
                    <p>Securely share files and folders with friends, family and colleagues for live collaboration. No email attachments required</p>
                </div>
            </div>
        </section>
    )
}
